                    deleteUser(usuario.rut);
                  }}
                >
                 Eliminar
                </button>
                <button
                  type="button"
                  class="btn btn-warning"
                  onClick={() => {
                    setUsuarioEditado(usuario);
                  }}
                >
                 Editar
                </button>

              </td> */}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default TablaUsuario;
